import React from 'react';
import NewsSlider from '../Widgets/NewsSlider/slider';
import NewsList from '../Widgets/NewsList/newsList';

const Home = () => {
    return (
        <div>
            <NewsSlider
                type="featured"
                start={1}
                amount={4}
                settings={{
                    dots: false

                }}
            />
            <NewsSlider
                type="featured"
                start={5}
                amount={7}
                settings={{
                    dots: false

                }}
            />
            <NewsList
                type="card"
                loadmore={true}
                start={1}
                amount={3}
            />
            <VideosList/>>


        </div>
    );
};

export default Home;
